member.summary:
If the file is imported from Cloud Storage or Google Drive,
sourceUri will be original file URI in Cloud Storage or Google Drive;
if file is uploaded, sourceUri will be file display name.

User provided version aliases so that a model version can be referenced via
alias (i.e. projects/{project}/locations/{location}/models/{model_id}@{version_alias}
instead of auto-generated version id (i.e. projects/{project}/locations/{location}/models/{model_id}@{version_id}).

Optional. Possible values of the element of Type.STRING with enum format.
For example we can define an Enum Direction as :
{type:STRING, format:enum, enum:["EAST", NORTH", "SOUTH", "WEST"]}
